import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu) using text and class selector
    const navMenuSelector = '.nav-menu';
    await page.waitForSelector(navMenuSelector, { timeout: 5000 });

    // Click the mobile menu trigger
    await page.click(navMenuSelector);

    // Wait for the mobile menu overlay to appear using ID and class
    const mobileMenuOverlaySelector = '#mobileMenuOverlay.mobile-menu-overlay';
    await page.waitForSelector(mobileMenuOverlaySelector, { timeout: 5000 });

    // Wait for the mobile menu itself to be present
    const mobileMenuSelector = '.mobile-menu';
    await page.waitForSelector(mobileMenuSelector, { timeout: 5000 });

    // Take screenshot of the open mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Find and click a navigation link inside the mobile menu (e.g., "Electronics")
    // Use xpath to find the first visible "Electronics" link inside the overlay
    const electronicsLinkXPath = "//div[contains(@class,'mobile-menu')]//a[contains(.,'Electronics')]";
    await page.waitForSelector(mobileMenuOverlaySelector + ' ' + 'a', { timeout: 5000 });
    const [electronicsLink] = await page.$x(electronicsLinkXPath);
    if (electronicsLink) {
      await electronicsLink.click();
    }

    // Take screenshot after clicking the Electronics link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_clicked.png'));

    // Close the mobile menu using the close button inside the overlay
    // Use a different selector: button with class 'close-mobile-menu' inside the overlay
    const closeBtnSelector = '#mobileMenuOverlay .close-mobile-menu';
    await page.waitForSelector(closeBtnSelector, { timeout: 5000 });
    await page.click(closeBtnSelector);

    // Wait for the overlay to disappear
    await page.waitForSelector(mobileMenuOverlaySelector, { state: 'hidden', timeout: 5000 });

    // Take screenshot after closing the mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    // Extract data: check if the main content now shows Electronics products (look for a heading or product card)
    // We'll look for a heading with "Electronics" or a product card with "Electronics" in the title
    let electronicsHeading = null;
    try {
      electronicsHeading = await page.$eval('h2', el => el.textContent || '');
    } catch {}
    let foundElectronicsProduct = false;
    try {
      foundElectronicsProduct = await page.$$eval('.product-title', nodes =>
        nodes.some(n => n.textContent && n.textContent.toLowerCase().includes('electronics'))
      );
    } catch {}

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, navigated to Electronics, closed menu, and verified content.",
      extractedData: {
        electronicsHeading,
        foundElectronicsProduct
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
